Inserts a dictionary of cache keys with  to the cache with the WriteThruOptions. 
The CacheItem contains properties to associate with the item, like expiration, dependencies and eviction information. 

Dictionary of keys and . Keys must be unique.>
 regarding updating data source. This can be WriteThru, WriteBehind or None.
